import React from "react";
import './summary.css';

const SummaryPage = ({closeSum})=>{
    return(
        <>
        <div className="modalBackground">
            <div className="card">
                <div className="h">
                <p>Summary</p>
                <button id="close" onClick={() => closeSum(false)}>X</button>
                </div>
            </div>
        </div>
        </>
    )
}
export default SummaryPage;
